import React from "react";
import Header from "./components/header/Header";
import Main from "./components/main/Main";

function App() {
  const houses = [
    { src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQQOA4haBi_TINgidyHxuXrw35uW2AuI-K9lw&s", alt: "Gryffindor" },
    { src: "https://i.pinimg.com/564x/4d/ab/0a/4dab0a87210b79bfbb9adbb5432847be.jpg", alt: "Ravenclaw" },
    { src: "https://i.pinimg.com/474x/5e/0c/22/5e0c229ce7e54e27d9b15bae77ab19e6.jpg", alt: "Slytherin" },
    { src: "https://i.pinimg.com/564x/ad/76/e8/ad76e8070c8a922a4a2920c28b6bb07b.jpg", alt: "Hufflepuff" }
  ];

  return (
    <>
      <Header />
      <Main houses={houses} />
    </> 
  );
}

export default App;
